import React from "react";
import { connect } from "react-redux";
import Burger from "../../components/Burger";
import Button from "../../components/General/Button";
import { Route, useNavigate } from "react-router-dom";
import css from "./style.module.css";
import ContactData from "../../components/ContactData";
const ShippingPage = (props) => {
  const navigate = useNavigate();
  return <ShippingPage1 {...props} navigate={navigate} />;
};
const mapStateToProps = (state) => {
  return {
    price: state.burgerReducer.totalPrice,
  };
};
export default connect(mapStateToProps)(ShippingPage);
class ShippingPage1 extends React.Component {
  showContactData = () => {
    const { navigate } = this.props;
    //this.props.history.replace("/ship/contact");
    navigate("/ship/contact", { replace: true });
  };
  cancelOrder = () => {
    const { navigate } = this.props;
    //this.props.history.goBack();
    navigate(-1);
  };

  render() {
    return (
      <div className={css.ShippingPage}>
        <p style={{ fontSize: "24px" }}>
          <strong>Таны захиалга амттай байх болно гэж найдаж байна...</strong>
        </p>
        <p style={{ fontSize: "24px" }}>
          <strong>Дүн : {this.props.price}₮</strong>
        </p>

        <Burger />

        <Button
          daragdsan={this.cancelOrder}
          btnType="Danger"
          text="ЗАХИАЛГЫГ ЦУЦЛАХ"
        />

        <Button
          daragdsan={this.showContactData}
          btnType="Success"
          text="ХҮРГЭЛТИЙН МЭДЭЭЛЭЛ ОРУУЛАХ"
        />

        <Route path="/ship/contact">
          <ContactData />
        </Route>
      </div>
    );
  }
}
